import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
// import AuthService from "./services/auth.service";
// import Login from "./components/login.component";
import Register from "./components/register.component";
// import Home from "./components/home.component";
// import Profile from "./components/profile.component";
// import BoardUser from "./components/board-user.component";
// import BoardModerator from "./components/board-moderator.component";
// import BoardAdmin from "./components/board-admin.component";
// import AuthVerify from "./common/auth-verify";
// import EventBus from "./common/EventBus";

class App extends React.Component {


  render(){
    // const { currentUser, showModeratorBoard, showAdminBoard } = this.state;
    return(
      <div>
        <div class="card bg">
          <img src="./bcg1.jpg"  class="card-img" alt="bckground img"/>
        <div class="card-img-overlay"> 
        <nav class="navbar navbar-expand-lg navbar-transparent bg-transparent">
        <div class="container-fluid">
          <img src="./logo.png" alt="Logo" width="180" height="120" class="d-aline-block align-text-inline"/>
            <div class="collapse navbar-collapse" id="navbarSupportedContent">
              <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <li class="nav-item">
                  <a class="nav-link active" aria-current="page" href="/home">Home</a>
                </li>
                <li class="nav-item dropdown">
                  <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                  Summer 2022
                  </a>
                  <ul class="dropdown-menu" aria-labelledby="navbarDropdown">
                    <li><a class="dropdown-item" href="#">Action</a></li>
                    <li><a class="dropdown-item" href="#">Another action</a></li>
                    <li><hr class="dropdown-divider"/></li>
                    <li><a class="dropdown-item" href="#">Something else here</a></li>
                  </ul>
                </li>
                <li class="nav-item">
                  <a class="nav-link">Weekends</a>
                </li>
              </ul>
              <div class="d-grid gap-2 d-md-flex justify-content-md-end">
                <button type="button" class="btn btn-outline-danger">Sign in</button>
                <button type="button" class="btn btn-danger">Sign up</button>
              </div>
            </div>
        </div>

        </nav>
        </div>
      </div>
      </div>
    )
  }
}

export default App;
